import React from "react";
import { View, ImageBackground } from "react-native";
import { makeStyles, Text, Button } from "@rneui/themed";

const image = { uri: "https://reactjs.org/logo-og.png" };

export default function App() {
  const styles = useStyles();

  return (
    <ImageBackground source={require('../assets/imgs/fondoLogin.jpg')} resizeMode="cover" style={styles.image}>
      <View style={styles.container}>
        <Text h3>Start Using RNE </Text>
        <Text style={styles.text}>
          Open up App.tsx to start working on your apps!
        </Text>
        <Button>Switch Theme</Button>
      </View>
    </ImageBackground>
  );
}

const useStyles = makeStyles((theme) => ({
  container: {
    display:"flex",
    alignItems: "center",
    justifyContent: "center",
  },
  image: {
    flex: 1,
    justifyContent: "center",
  },
  text: {
    marginVertical: theme.spacing.lg,
  },
}));
